	public Object clone()	{		Name theCopy = null;		try		{			theCopy = (Name)super.clone();		}		catch (CloneNotSupportedException e)		{			System.err.println("Name cannot clone: " + e.toString());		}		return theCopy;	} // end clone// ALTERNATE CODE:/*	public Object clone()	{		try		{			Name theCopy = (Name) super.clone();			return theCopy;		}		catch (CloneNotSupportedException e)		{			throw new Error(e.toString()); // using throw avoids syntax			                               // error of missing return        }	} // end clone